import React from "react";
import Head from "../components/Head";
import Navbar from "../components/Navbar";

function PrincipalPage() {
  return (
    <div>
      <div className="flex justify-center items-center">
          <Head />
      </div>
      <div className="flex justify-center items-center">
          <Navbar />
      </div>
    </div>
  );
}

export default PrincipalPage;
